import React from 'react'
import { connect } from 'react-redux'
import { createStructuredSelector } from 'reselect'
import { womenOptions } from '../../redux/women/women.selector'

const ShopWomens = ({ options }) => {

  return (
    <div>
      {
        options.map((item) => {
          return <ul>{item}</ul>
        })
      }
    </div>
  )
}

const mapStateToProps = createStructuredSelector({
  options: womenOptions
})

export default connect(mapStateToProps, null)(ShopWomens)
